Latest info on the cancelled Taylor Hawkins tickets saga
@TicketmasterUK are citing "booking irregularities" and have advised @SJMConcerts are responsible for cancelling tickets.
@gigsandtours are citing "breach of terms and conditions" but are not specifying what the breach is.

